script: |
  super -f text -I q9672.spq | sort > q9672.out

inputs:
  - name: q9672.spq
    data: |
      SELECT ALL - 27 * - col2 + col0 AS col1 FROM tab1 (FORMAT parquet) WHERE NOT ( - 41 ) BETWEEN col1 AND ( + + col2 + + - 14 );
  - name: tab1

outputs:
  - name: q9672.out
    data: |
      1678
      1927
      2643
